]

const Image = ({ image }) => (
  <div className='card'>
    <img
      src={image.source}
      alt='Imagen'
      className='image'
    />
    <div className='footer'>
      <img
        src={image.author.avatar}
        alt='Avatar'
        className='avatar'
      />
      <div>
        {image.author.name}
      </div>
      <div>
        {image.views}
      </div>
    </div>
  </div>
)

class Arriendos extends Component {
  render () {
    return (
      <div className='arriendos'>
        {images.map(arriendos => (
          <Image
            image={arriendos}
            key={arriendos.id}
          />
        ))}
      </div>
    )
  }
}

export default Arriendos
